{\n        \"use strict\";\n        if (min !== Infinity &amp;&amp; max !== -Infinity) {\n            pad = pad ? (max - min) * .03 : 0;\n            range.start = min - pad;\n            range.end = max + pad;\n        } else console.error('backtesting: scale range error:', min, max, range);\n    };\n}\n\nclearTimeout(window._bt_autoscale_timeout);\n\nwindow._bt_autoscale_timeout = setTimeout(function () {\n    /**\n     * @variable cb_obj `fig_ohlc.x_range`.\n     * @variable source `ColumnDataSource`\n     * @variable ohlc_range `fig_ohlc.y_range`.\n     * @variable volume_range `fig_volume.y_range`.\n     */\n    \"use strict\";\n\n    let i = Math.max(Math.floor(cb_obj.start), 0),\n        j = Math.min(Math.ceil(cb_obj.end), source.data['ohlc_high'].length);\n\n    let max = Math.max.apply(null, source.data['ohlc_high'].slice(i, j)),\n        min = Math.min.apply(null, source.data['ohlc_low'].slice(i, j));\n    _bt_scale_range(ohlc_range, min, max, true);\n\n    if (volume_range) {\n        max = Math.max.apply(null, source.data['Volume'].slice(i, j));\n        _bt_scale_range(volume_range, 0, max * 1.03, false);\n    }\n\n}, 50);\n"},"id":"1075528","type":"CustomJS"},{"attributes":{"source":{"id":"1075288"}},"id":"1075293","type":"CDSView"},{"attributes":{"overlay":{"id":"1075437"}},"id":"1075432","type":"BoxZoomTool"},{"attributes":{"source":{"id":"1075266"}},"id":"1075271","type":"CDSView"},{"attributes":{"data":{"Close":{"__ndarray__":"PQrXo3AdTEApXI/C9ShMQFyPwvUoHExApHA9CtdDTEDXo3A9CldMQD0K16NwfUxA16NwPQrXTEBcj8L1KLxMQEjhehSup0xAAAAAAABATECPwvUoXG9MQD0K16Nw3UtAFK5H4Xo0S0DNzMzMzIxLQLgehetRGExAAAAAAACAS0CamZmZmZlLQFyPwvUoXEpASOF6FK4nSkDhehSuR2FKQEjhehSup0pACtejcD2KSkCuR+F6FI5IQEjhehSuB0lAw/UoXI+iSEDXo3A9CndIQJqZmZmZGUhA7FG4HoULSEApXI/C9UhIQFyPwvUovEhAFK5H4Xr0SEDXo3A9CtdIQOF6FK5HAUlAj8L1KFzPSEAUrkfhetRIQIXrUbgepUhAexSuR+H6SUAUrkfhepRJQAAAAAAAwElAhetRuB7lSUCuR+F6FK5JQJqZmZmZmUpACtejcD1qSkA9CtejcL1LQClcj8L1CExA16NwPQoXTEDNzMzMzAxMQGZmZmZmBkxA16NwPQo3TEDsUbgehQt
